 be valid following correction."]],["Valid UMIs",["Fraction of reads with valid UMIs; i.e. UMI sequences that do not contain Ns and that are not homopolymers."]],["Sequencing saturation",["The fraction of reads originating from an already-observed UMI. This is a function of library complexity and sequencing depth. More specifically, this is the fraction of confidently mapped, valid cell-barcode, valid UMI reads that had a non-unique (cell-barcode, UMI, gene). This metric was called 'cDNA PCR Duplication' in versions of Cell Ranger prior to 1.2."]],["Confidently mapped reads in cells",["The fraction of valid-barcode, valid-UMI, confidently-mapped-to-transcriptome reads with cell-associated barcodes."]],["Mean reads per cell",["The total number of sequenced read pairs divided by the number of cell-associated barcodes."]]]}},"mapping_metrics_table":{"table":{"header":["Physical library ID","Number of reads in the library","Mapped to genome","Confidently mapped to genome","Confidently mapped to transcriptome","Confidently mapped to intronic regions","Confidently mapped to exonic regions","Confidently mapped to intergenic regions","Confidently mapped antisense"],"rows":[["GEX_1","640,156,463","95.96%","93.15%","71.29%","33.47%","55.23%","4.45%","16.73%"]]},"help":{"title":"Mapping Metrics (Amongst All Reads in Library)","data":[["Physical library ID",["Unique identifier for each library."]],["Number of reads in the library",["The total number of reads in the library."]],["Mapped to genome",["Fraction of reads that mapped to the genome."]],["Confidently mapped to genome",["Fraction of reads that mapped uniquely to the genome. If a gene mapped to exonic loci from a single gene and also to non-exonic loci, it is considered uniquely mapped to one of the exonic loci."]],["Confidently mapped to transcriptome",["Fraction of reads that mapped to a unique gene in the transcriptome. The read must be consistent with annotated splice junctions. These reads are considered for UMI cou
